import React from 'react'

const Main = () => {
    return (
        <div className="jumbotron jumbotron-fluid bg-info">
            <div className="container">
                <h1 className="display-2 text-center">(REACT) Google Books Search</h1>
                <p className="lead text-center"><strong>Search for and Save Books of Interest</strong></p>
            </div>
        </div>
    )
}

export default Main
